import React from "react";
import NavBar from "./NavBar";
import SocialNetwork from "./SocialNetwork";
import Card from "./Card";

const Project = ()=>{
    return (
        <>
            <NavBar/>
            <SocialNetwork/>
            <div className="project">
                <Card link = "https://github.com/Nandpatel1/Blog-Website" imgsrc = "image/blog website.png" name = "myname"/>
                <Card link = "" imgsrc = "image/Car game.png" name = "myname"/>
                <Card link = "" imgsrc = "image/weather app.png" name = "myname"/>
                <Card link = "" imgsrc = "image/notes.png" name = "myname"/>
                <Card link = "" imgsrc = "image/quotes.png" name = "myname"/>
                <Card link = "" imgsrc = "image/my library.png" name = "myname"/>
            </div> 
        </>
    )
}

export default Project;
